import './Footer.scss';
import { Container,Row,Col } from 'react-bootstrap';

export default function Footer (){
    return(
        <Container>
            <Row>
                <Col lg="6" className="footer-col text-center" lg="12">
                    <img src="" alt="google+"/>
                    <img src="" alt="facebook"/>
                    <img src="" alt="twitter"/>
                    <img src="" alt="instagram"/>
                </Col>
                <Col lg="12" className="text-center">
                    <p>www.logo.org</p>
                </Col>
            </Row>
        </Container>
    )
}
